import React, { useState } from "react";
import logo from "../Images/logo.png";


const Header = () =>{
  // let [activeCol, setActiveCol] =useState(false);

  // let activeClass = () =>{
    // setActiveCol(!activeClass)
  // }


 

    return(

        <nav className="navbar navbar-expand-lg bg-body-tertiary">
  <div className="container">
    <a className="navbar-brand" href="#home">
    <img src={logo} alt="logo" width="20.8rem"/>
    </a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav m-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <a className="nav-link active" aria-current="page" href="#home" onClick={activeClass}>Home</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#features">Features</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#pricing">Price</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#frequent">Faq</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#contact">Contact</a>
        </li>
        
      </ul>
      <form className="d-flex">
        <a href="#contact" className="btn btn-outline-success btn-1" type="submit" >Login</a>
        <button className="btn btn-outline-success btn-2" type="submit">Register</button>
      </form>
    </div>
  </div>
</nav>

        
        
    )
}

export default Header;
